package week2.day2;

public class LearnPrimitiveDataTypes {

	/*
	 * 1.Int
	 * 2.Short
	 * 3.Float
	 * 4.Boolean
	 * 5.Char
	 * 6.Double
	 * 7.Long
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int price =25000;
		float phoneSize=6.5f;
		boolean isAndriod=true;
		char logo='m';
		long phone=12345780l;
		short weight =13;
		double phonesi=12.44;
		
		System.out.println(price);
		System.out.println(phoneSize);
		System.out.println(isAndriod);
		System.out.println(logo);
		System.out.println(phone);
		System.out.println(weight);
		System.out.println(phonesi);
				

	}

}
